  "in_reply_to_user_id" : 3119862113,
  "text" : "The vocals are the main attraction but they\u2019re not executed to show-off vocal prowess. It\u2019s made to complete the simple background and express lyrics of contentment. The song was never sang in a way that it wasn't meant to be. There were no belting. There were no runs. #iKON",
