  "id_str" : "1090458026614566913",
  "in_reply_to_user_id" : 3119862113,
  "text" : "It was just sang as simple as all the other components in the song. However, the execution really is impressive. The song never tried to be anything it's not. It didn't try to be overly hiphop, ballad, or pop. It's just LOVE SCENARIO. That simplicity became it's identity. #iKON",
