  "id_str" : "1090457460928737281",
  "in_reply_to_user_id" : 3119862113,
  "text" : "Singing is different from talking because you sustain notes &amp; pitches. Sometimes, that idea becomes intimidating to those who don't know how to sing. Hanbin's persistent urge to the members to sing in a way of emulating the idea of speaking made song even more approachable. #iKON",
