  "geo" : { },
  "id_str" : "1090457456545656832",
  "in_reply_to_user_id" : 3119862113,
  "text" : "I don't know if you guys have noticed this but there are a lot of KPOP music out there that seems to be three different songs stitched together with a similarly over-layered MV. Imho, this is done to overstimulate the listener to keep them listening and watching.",
  "id" : 1090457456545656832,
