  "id_str" : "1090457457439035392",
  "in_reply_to_user_id" : 3119862113,
  "text" : "However, what #iKON did with this song was that they took influences from different genres, crushed it, and blended it all together with such class and sophistication. This is why although the song have different musical influences, it still sounds cohesive and STIMULATING.",
