  "id_str" : "1090457458303131648",
  "in_reply_to_user_id" : 3119862113,
  "text" : "This is why the song sounds so familiar yet some can't exactly determine why it is so. In a saturated industry dominated by fast-paced &amp; over-produced songs, Love Scenario came at the right time to give the industry a much needed breather. Love Scenario is refreshing. #iKON",
