  "in_reply_to_user_id" : 3119862113,
  "text" : "#Hanbin's insistence to make the vocals the driving force of this song was ingenious. This is bec Hanbin didn't do it to show off their vocal capabilities. He made the vocals at the forefront to 1) bring focus to the lyrics and 2) to balance out the simple background. #iKON",
