  "in_reply_to_user_id" : 3119862113,
  "text" : "Since the bg is simple, he tried to compensate it as well through vocal tones and the style of singing. Remember when #Hanbin said that he wants the members to sing as if they were just throwing words? That's one of the reasons why this song became a hit. #iKON @YG_iKONIC",
