  "id_str" : "1090457453005758465",
  "in_reply_to_user_id" : 3119862113,
  "text" : "When #June's part enters, a whole different vibe is executed by the mere addition of claps, bass and the piano melody. The re-introduction of the metronome at the latter part of June's part was a perfect transition to #Jinhwan's part. It made the two sections cohesive.",
