  "in_reply_to_user_id" : 3119862113,
  "text" : "But as you listen to Jinhwan's part, the vibe changes. Which may be surprising since it has the same accompaniments w\/ June's part. However, listen to the electric piano (synth) that seems to sing along. That ALONE changes the ENTIRE feel of the section.\nhttps:\/\/t.co\/SBJRiNczto",
