  "geo" : { },
  "id_str" : "1090457454683406336",
  "in_reply_to_user_id" : 3119862113,
  "text" : "This is why I've always said that #Hanbin knows when to give &amp; when to take. He knows the balance of things being too much and too less. Even their transitions per music section is done so effortlessly without breaking flow. The entire song just screams, \"ENOUGH is ENOUGH.\" #iKON",
