  "in_reply_to_user_id" : 3119862113,
  "text" : "#Hanbin created simple lines of bass, piano, &amp; metronome. The musical composition was simple &amp; 1+1=2. You would think that simple+simple=simple. But Hanbin managed to create a musical bg that is so charming that it rings in your ears once you hear it and that is no simple feat.",
