  "text" : "Sidenote 1.0: When I say staccato melody from the piano, the keys played from the left hand are not played in sync with the R. hand. So the piano melody is played like this: RLRL for the most part. Although notes are not sustained, no sec\/beat was left empty in the piano melody.",
