  "in_reply_to_user_id" : 3119862113,
  "text" : "Sidenote 2.0: I'm not sure if I'm using the right technical term here but from what I remember, syncopation is when the drop of the beat falls awkwardly than expected. It's like a delay of drop. It makes melodies really groovy. This is why the bass of this song is GOLD.",
