  "text" : "Now, notice how even if the only predominant sound is the metronome (the tapping sound), you don't feel as if the bg is empty. For example (timestamp on vid), there's only 3 main things at play here: DK's vocal, vocal harmony at the bg, &amp; the metronome. \n\nhttps:\/\/t.co\/hYKDV7HAdT",
