  "text" : "But as you listen to it, you'll never think that the production is lacking. This is because the vocal harmony in the background grabs your attention away from the singularity of the instrumentation. The vocal harmony was used as the main instrumentation instead. #iKON",
  "id" : 1090457452024233984,
