  "in_reply_to_user_id" : 3119862113,
  "text" : "However, it sounds weird from a musically inclined person's perspective. I won't get into the whys but to me that weirdness became the charm of the song. It was a hit because we didn't realize that a simple song like this can leave us feeling relieved until we heard it. #iKON",
