  "in_reply_to_user_id" : 3119862113,
  "text" : "#Hanbin's usage of staccato (when notes are played as if each note is detached to one another i.e. Metronome and piano melody) and sustain (when notes are prolonged i.e. bass and synths) were executed with such sophistication. It NEVER got too much, just ENOUGH. #iKON @YG_iKONIC",
