  "in_reply_to_user_id" : 3119862113,
  "text" : "#Hanbin compensated that feeling of emptiness with three main different things: another staccato melody from the piano, a syncopated but sustained bass, and the usage of vocal harmony to fill the void. #iKON @YG_iKONIC",
