  "in_reply_to_user_id" : 3119862113,
  "text" : "When composers, imho, create music as simple as this one, the intention becomes clearer: the composer intended it to be SIMPLE. It is either because the musician wants to bring light into the lyrics or the musician wants the instrumentals to be focused on. #iKON",
