  "geo" : { },
  "id_str" : "1090457442868064256",
  "in_reply_to_user_id" : 3119862113,
  "text" : "Take note that not all simple things are created with beauty in mind. Like the idea of minimalism, the purpose of it is to maintain a lifestyle centered on necessity with minimal regard for aesthetics. However, not all minimalist approaches are created without complexity. #iKON",
