  "id_str" : "1089264459460206592",
  "in_reply_to_user_id" : 3119862113,
  "text" : "Like I stated above in my first song interpretation, in the song, the phrase \"I'm Ok\" carries a double meaning. 'I'm ok' is a phrase used to symbolize the internal battle of wanting to be ok while shunning any forms of comfort to be ok. #iKON @YG_iKONIC",
