  "id_str" : "1089264461385424896",
  "in_reply_to_user_id" : 3119862113,
  "text" : "The reason why these reactors are going crazy about this song is because the song itself deviates away from the conventional musical composition styles. The music composition never goes to where you expect it to be.",
