  "id_str" : "1089264455928537088",
  "in_reply_to_user_id" : 3119862113,
  "text" : "What #Hanbin did in this song was he used a major chord that is immediately followed by a minor chord while singing the lyrics \"I'm Ok.\" Which is, to me, impressive on its own because the dissonance of the music composition supported the dissonance portrayed in the lyrics. #iKON",
