  "id_str" : "1084494554621894656",
  "text" : "There's a lot of meaning that could be lost online. Before tweeting anything, not that I'm being a grammar nazi, wrong grammar and punctuation can lead to misunderstanding. Even wrong choice of words can lead to something you never intended to. Keep those in mind, iKONICS! :)",
