  "id_str" : "1082845144364150785",
  "in_reply_to_user_id" : 3119862113,
  "text" : "Just like how waves can cause an entire ocean to tremble, the weight and grandeur of love lost is unfathomable\/immeasurable. Just like how the autumn leaves tremble when the wind blows, we are all submissive and vulnerable to love. #iKON",
