  "text" : "I thought to myself: \"The boys are really back. They are REALLY back. This is the #iKON I've loved from the very beginning.\" And I just remember crying so hard because it seemed so unrealistically real. Bias aside, New Kids: Return took me off guard. https:\/\/t.co\/gpq6eOiRE7",
